import React from "react";
import Typography from "@mui/material/Typography";
import { Container } from "@mui/material";
const Todo_list = () => {
  return (
    <React.Fragment>
      <Container>
        <Typography variant="h1" color="primary" component="h1">
          Todo_list
        </Typography>
      </Container>
    </React.Fragment>
  );
};

export default Todo_list;
